import { useState } from 'react'
import Buttons from './Buttons'
import Display from './Display'


function App() {

  const [state, setState] = useState({
    input: 0,
    output: ""
  }) 


 const inputValue = (e) =>{
   setState({
     input: +"1",
     output: state.input
   })
 }


  return (
    <div className="App">
      <div className="display">
          <Display state={state} />
        </div>
        <div className="buttons">
          <Buttons inputValue={inputValue} state={state} />
        </div>

    </div>
  );
}

export default App;
